import React from "react";
import { StyleSheet, Text, View } from "react-native";

const ModifyScreen = () => {
  return (
    <View style={styles.container}>
      <Text>Modify Screen</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});

export default ModifyScreen;
